  01> MCMILLAN, Scott Edward
  b 09.09.1997
  03> COOPER, Vivienne Jean m on 13.09.1997 to BROWN, Noel Graeme
  b 14.04.1939
  b 12.06.1925
  Vivienne b. at Kerikeri. Noel, slo George and Dorothy Brown of Wellington. Noel has three daughters and
  a son (deceased) and seven grandchildren. Address: PO Box 136, Paihia.
  Viv was educated at Whangarei Girls' High School and qualified as a registered kindergarten teacher in
  1965. She held a charge position in Kaikohe for 2 years then qualified as a registered general and
  obstetric nurse at Greenlane Hospital, Auckland. She nursed in the Auckland area and then in the UK for
  three years then spent 12 years in Greater Auckland as a public health nurse. For the last four years
  of this period she was Administration Supervisor of Nurses. She gained an Advanced Diploma of Nursing
  Studies in 1980. Viv was also a Captain in the Army Nursing Corps of the Territorial Army for five
  years.
  Viv and Noel have been in Paihia for the past thirteen years and during that time they have both worked
  in time-shares in the area. Viv has also been involved with private nursing care. Noel, a retired
  pharmacist, is enjoying having more spare time. They now enjoy spending time in their garden or
  travelling or in the community activities with which they are involved.
  64> COOPER, Philip Rodney
  b 06.04.1946
  Philip b. at Kerikeri.
  Phil was educated at Whangarei Boys' High School. He has always been interested in flying. While still
  at school he was in the Air Training Corps and won a flying scholarship. He was captain of the
  Whangarei Aero Club for a period. He is a qualified airline transport pilot and has spent many years
  based in Kenya flying aid to Sudan and Somalia. His is still based there, with his own flying company,
  and contracting to the United Nations.
  Flying has always been the main interest in Phil's life. When not in the air, he enjoys exploring the
  open spaces of Africa and the wild animal life there.
  04> HADFIELD, Hilda Mary m on 29.03.1931 to HAWKES, Charles Adderley
  b 03.10.1905 d 15.02.1961
  b 29.03.1892 d 16.05.1974
  Hilda b. at Paraparaumu and d. at Nelson, Charles b. at Stratford on Avon and d. at Nelson.
  Hilda was an artist. Charles served in the Merchant Navy during ww1 then managed tea plantations in Assam
  until her came to New Zealand about 1930. Hilda and Charles lived at Kerikeri for six years until 1939 when
  they went to England. In 1941 Charles joined the Royal Naval Volunteer Reserve and served on land and sea
  until 1947. Hilda and the children returned to New Zealand in 1946 and Charles came back in 1948. He worked
  for the Naval Department in Wellington until he retired to Nelson in the late 1950's.
  01> HAWKES, Gordon
  b ** ** 1932 d ** ** ****
  Gordon d. at six weeks and bd. in Kerikeri Cemetery.
